import React from "react";
import Product from "../components/Product";
import { useSelector } from "react-redux";

const Home = (props) => {
  const products = props.products;
  const cart = useSelector()
  return (
    <div className="flex bg-yellow-100 py-8 justify-center">
      <div className="sm:w-[80%] lg:w-[80%] justify-center  flex flex-wrap gap-8 ">
        {products.map((data) => (
          <Product key={data.id} data={data} />
        ))}
      </div>
    </div>
  );
};

export default Home;
